var engine = new Liquid.Liquid();
engine.registerFilter('json_markdown', v => {
  return JSON.stringify(JSON.stringify(v, null, 4).replace(/"/g, "").replace(/{/g,"").replace(/}/g,"").replace(/,/g,"")).replace(/"/g, "")
});

engine.registerFilter("jsonify", (v) => {
  return JSON.stringify(v);
});

engine.registerFilter("keys", (v) => {
  return Object.keys(v) || [];
});

engine.registerFilter("dig", (v, ...arg) => {
  return _.get(v,[...arg])
});

try{
    engine
    .parseAndRender(msg.template, msg.alert)
    .then(rendered => {
        msg.payload = rendered;
        node.send(msg)
        })
    .catch(err => node.error(err))  
}catch(e){
    node.error(e)
}

